import './App.css';
import Home from "./pages/Home"
import Header from "./Components/header"
import { BrowserRouter as Router,Route} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Router>
        <Header/>
        <Route path='/' element={<Home/>}/>

      </Router>

    </div>
  );
}

export default App;
